import React from 'react'
import './Projects.css'
import ProjectsItem from './ProjectsItem'
import OwlCarousel from 'react-owl-carousel';
import 'owl.carousel/dist/assets/owl.carousel.css';
import 'owl.carousel/dist/assets/owl.theme.default.css';


export default function Projects() {

    return (
        <div className="Projects-main">
            <div className="titles">
                <h2> My projects </h2>
            </div>

            {/* <div className="Projects-Parent"> */}

            <OwlCarousel 

                className=' Projects-Parent owl-theme' 
                autoplayTimeout={1000} 
                autoplay={true}
                autoplayHoverPause={true}
                rewind={true}
                responsive={{
                        0:{
                            items:1
                        },
                        500:{
                            items:2
                        },
                        600:{
                            items:3
                        },
                        700:{
                            items:2
                        },
                        1230:{
                            items:3
                        }
                    }} nav>
            
                <ProjectsItem className="item" image="03_Homepage.jfif" webSiteName="Organization Portfolio" />
                <ProjectsItem className="item" image="03_Homepage.jfif" webSiteName="Online Shop" />
                <ProjectsItem className="item" image="03_Homepage.jfif" switchSides={true} webSiteName="School's Website"/>
                

            </OwlCarousel>


            {/* </div> */}
        </div>
    )
}
